import React, { useEffect, useState } from "react";
import axios from "axios";

function Map(props) {
  const [mapData, setMapData] = useState("");

  useEffect(() => {
    // 서버로부터 HTML 데이터를 가져오는 AJAX 요청
    axios
      .get(`http://13.209.235.204:8000/map/${props.option}/${props.day}/`)
      .then((response) => {
        setMapData(response.data);
      })
      .catch((error) => {
        console.error("Error fetching HTML data:", error);
      });
  }, []);
  return (
    <div
      className="Map"
      style={{
        marginTop: "0rem",
        width: "55vw",
        height: "38rem",
        border: "0.05rem solid rgba(0, 0, 0, 0.148)",
      }}
      dangerouslySetInnerHTML={{ __html: mapData }}
    ></div>
  );
}

export default Map;
